export default function contact() {
  return (
    <>
      <div className="container-fluid" id="onl">
        <div className="Api">
          <h5>Contact</h5>
          <h3>
            Need Help? <span className="bitu">Contact US</span>
          </h3>
        </div>
      </div>
    </>
  );
}
